import Header from "../Header";
import Main from "../Main";
import Footer from "../Footer";

import { BrowserRouter as Router, Route, Routes  } from 'react-router-dom';

export default function Content(){
    return(
        <Router>
            <Header/>
            <Router>
                <Routes>
                    <Route path='/findjobs' element={<Main />} />
                </Routes>
            </Router>
            <Footer/>
        </Router>
    )
}
